            if (office.ApprovedObservationStationsOption.IsSet)
            {
                writer.WritePropertyName("approvedObservationStations");
                JsonSerializer.Serialize(writer, office.ApprovedObservationStations, jsonSerializerOptions);
            }
        }
    }
}
